import { Component, OnInit } from '@angular/core';
import { Patient } from 'src/app/models/patient';
import { HttpClient } from '@angular/common/http';
import { PatientResponseModel } from 'src/app/models/patientResponseModel';

@Component({
  selector: 'app-patient',
  templateUrl: './patient.component.html',
  styleUrls: ['./patient.component.scss']
})
export class PatientComponent implements OnInit{

  patients:Patient[] = [];
  apiUrl = "https://localhost:7126/api/Patients/getall";
  patientResponseModel:PatientResponseModel={
    data: this.patients,
    message: "",
    success: true
  };

  constructor(private httpClient:HttpClient) {}

  ngOnInit(): void {

  }

  getPatients(){
    this.httpClient.get<PatientResponseModel>(this.apiUrl).subscribe((res) => {
      this.patients = res.data;
    });
  }
}
